import NewList from "./NewList";
import { FaMinusSquare, FaPlusSquare, FaTrash } from "react-icons/fa";
import { useState } from "react";

const List = ({ list, onListToggle, toggleKey, onDelete }) => {
  // console.log(list);

  const [toggleList, setToggle] = useState(true);
  const onToggle = (e) => {
    setToggle(!toggleList);
  };

  const deletekey = async (e) => {
    console.log("list", e);
    console.log(e.target.value);
  };
  return (
    <>
      {Object.keys(list).length
        ? Object.keys(list).map((key, i) => (
            <ul type="none" key={key}>
              <li value={key}>
                {Object.keys(list[key]).length ? (
                  toggleList ? (
                    <FaPlusSquare
                      style={{
                        fontSize: "0.75rem",
                        paddingRight: "0.25rem",
                        cursor: "pointer",
                      }}
                      onClick={onToggle}
                    />
                  ) : (
                    <FaMinusSquare
                      style={{
                        fontSize: "0.75rem",
                        paddingRight: "0.25rem",
                        cursor: "pointer",
                      }}
                      onClick={onToggle}
                    />
                  )
                ) : null}
                {key}{" "}
                <span value={key} onClick={deletekey}>
                  <FaTrash
                    style={{
                      cursor: "pointer",
                      float: "right",
                      marginRight: "40rem",
                      fontSize: "0.75rem",
                    }}
                  />
                </span>
              </li>
              {!toggleList ? (
                <NewList
                  list={list[key]}
                  onListToggle={onListToggle}
                  toggleKey={toggleKey}
                  onDelete={onDelete}
                />
              ) : null}
            </ul>
          ))
        : null}
    </>
  );
};

export default List;
